('merchant_welcome_message', '<p><span style="font-family:Arial,Helvetica,sans-serif"><span style="font-size:16px">يسر شركة ايجي باي الترحيب بكم لانضمامكم الى قائمة عملائها &nbsp;</span></span></p>\r\n\r\n<p><strong><span style="font-size:16px"><span style="font-family:Arial,Helvetica,sans-serif">نبذة تعريفية:&nbsp;</span></span></strong></p>\r\n\r\n<p><span style="font-size:16px"><span style="font-family:Arial,Helvetica,sans-serif">شركة ايجي باي هي شركة مساهمة مصرية تقدم خدمات الدفع الالكتروني والتحصيل والتجارة الالكترونية للسوق المصري باستخدام احدث وسائل التكنولوجيا واعلى معايير الأمان.</span></span></p>\r\n\r\n<p><strong><span style="font-size:16px"><span style="font-family:Arial,Helvetica,sans-serif">خدماتنا:&nbsp;</span></span></strong></p>\r\n\r\n<p><span style="font-size:16px"><span style="font-family:Arial,Helvetica,sans-serif">عن طريق زيارتكم لموقعنا الالكتروني يمكنكم التعرف اكثر على قائمة خدمات ايجي باي <a href="https://www.egpay.com">www.egpay.com</a></span></span></p>\r\n\r\n<p><strong><span style="font-size:16px"><span style="font-family:Arial,Helvetica,sans-serif">للتواصل:</span></span></strong></p>\r\n\r\n<p><strong><span style="font-size:16px"><span style="font-family:Arial,Helvetica,sans-serif">تليفون:&nbsp;</span></span></strong><span style="font-size:16px"><span style="font-family:Arial,Helvetica,sans-serif">0222760666 - 0222760660</span></span></p>\r\n\r\n<p><strong><span style="font-size:16px"><span style="font-family:Arial,Helvetica,sans-serif">بريد الكتروني:&nbsp;</span></span></strong><span style="font-size:16px"><span style="font-family:Arial,Helvetica,sans-serif">customercare@egpay.com</span></span></p>\r\n\r\n<p><strong><span style="font-size:16px"><span style="font-family:Arial,Helvetica,sans-serif">للايداعات البنكية:</span></span></strong></p>\r\n\r\n<table border="1" cellpadding="1" cellspacing="1" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>اسم البنك</strong></td>\r\n			<td><strong>رقم الحساب</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Qnbalahli</strong></td>\r\n			<td><strong>2031760966072</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>البنك الأهلي المصري&nbsp;</strong></td>\r\n			<td><strong>1283070867692701011</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>بنك الإسكندرية</strong></td>\r\n			<td><strong>144048623001</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>بنك مصر</strong></td>\r\n			<td><strong>1930001000001545</strong></td>\r\n		</tr>\r\n	</tbody>\r\n</table>', 'Welcome Message', 'Welcome Message', 'textarea', NULL, 'Merchant', 5, '2017-12-13 18:00:00', '2018-05-30 11:31:07'),
